import React from "react";

function Students(props) {
  return (
    <div className="row mt-3">
      <div className="container">
        <div className="col-8">
          <table className="table table-striped">
            <thead>
              <th>Id</th>
              <th>Fullname</th>
              <th>Age</th>
              <th>Phone Number</th>
              <th>Email</th>
              <th>Course</th>
              <th>GPA</th>
            </thead>
          </table>
        </div>
      </div>
    </div>
  );
}

export default Students;
